import React from 'react';
import './Cards.css';



function Cards() {
  return (
    <div className='cards'>
        <div className='container'>
          <h1> Master Plan <br/></h1>
            <div className='container-image'>
              <img style={{ width: '100px', height: 'auto' }}src='./images/PlanMaestro.png' />
            </div>
        </div>
    </div>
  );
}

export default Cards;
